import { useState } from "react"

const ProfileStatus = (props) => {

    const state = {
        editMode: false
    }

    const activatedMode = () =>{
        console.log('hellos')
        setState({
            editMode: true
        })
    }

    return (
        <>
            {!state.editMode
            ?<span onDoubleClick={ activatedMode }>Hello</span>
            :<input  value='hello' />}
        </>
    )
}

export default ProfileStatus
